                        id="authLoginField"
                        v-model="login"
                        label="Логин"
                        dense
                        @input="$v.login.$touch()"
                        @blur="$v.login.$touch()"
                        :error-messages="loginErrors"
                        v-on:keyup.enter="onloginenterclick"
                    />
                    <v-text-field
                        id="authPasswordField"
                        v-model="password"
                        label="Пароль"
                        dense
                        @input="$v.password.$touch(); wrong=false; badconnection=false"
                        @blur="$v.password.$touch()"
                        :append-icon="showpassword ? mdiEyeOutline : mdiEyeOffOutline"
                        @click:append="showpassword = !showpassword"
                        :type="showpassword ? 'text' : 'password'"
                        :error-messages="passwordErrors"
                        v-on:keyup.enter="onpasswordenterclick"
                    />
                </form>
