<script>
    import routbackmixin from "@/plugins/routbackmixin";
    import {validationMixin} from 'vuelidate'
    import {required, maxLength, minLength} from 'vuelidate/lib/validators'
    import {mdiEyeOutline, mdiEyeOffOutline} from '@mdi/js'
    import Cam from "../../components/Cam";

    export default {
        components: {Cam},
        mixins: [validationMixin, routbackmixin('/map')],
        validations: {
            login: {
                required,
                // maxLength: maxLength(16),
                // minLength: minLength(4),
            },
            password: {
                required,
                // maxLength: maxLength(72),
                // minLength: minLength(4)
            },
        },
        data: () => ({
            size: false,
            wrong: false,
            badconnection: false,
            showpassword: false,
            login: process.env.NODE_ENV === 'development' ? 'admin1' : '',
            password: process.env.NODE_ENV === 'development' ? 'test' : '',
            prevPath:'/web/tasks',
            animate: false,
            mdiEyeOutline, mdiEyeOffOutline
        }),
        computed: {
            loginErrors () {
                const errors = []
                if (!this.$v.login.$dirty) return errors
                    !this.$v.login.required && errors.push('Это обязательное поле')
                    // this.wrong && errors.push('')
                    // !this.$v.login.maxLength && errors.push('Логин слишком длинный')
                    // !this.$v.login.minLength && errors.push('Логин слишком короткий')
                if(this.wrong){
                    errors.push('')
                }
                return errors
            },
            passwordErrors () {
                const errors = []
                if (!this.$v.password.$dirty) return errors
                    !this.$v.password.required && errors.push('Это обязательное поле')
                    // this.wrong && errors.push('Неверный логин или пароль')
                    // !this.$v.password.maxLength && errors.push('Пароль слишком длинный')
                    // !this.$v.password.minLength && errors.push('Пароль слишком короткий')
                if(this.wrong){
                    errors.push('Неправильно введён логин или пароль')
                }
                if(this.badconnection){
                    errors.push('Внутренняя ошибка авторизации')
                }
                return errors
            },
        },

        methods: {
            submit() {
                this.wrong = false
                this.badconnection = false
                this.$v.$touch()
                if (this.$v.$invalid) {
                    notify({theme: 'red', text:`некорректный ввод`})
                }
                else {
                    this.animate=true
                    this.$store.dispatch('AUTH_LOGIN', { login: this.login, password: this.password })
                        .then((x) => {
                            this.animate=false
                            this.routerBack()
                        })
                        .catch((err)=>{
                            if(err.response.status === 404){
                                this.wrong=true
                                this.animate=false
                                this.$v.$touch()
                            }
                            else {
                                this.badconnection = true
                                this.animate=false
                                this.$v.$touch()
                            }
                        })
                }
            },
            clear () {
                this.$v.$reset()
                this.login = ''
                this.password = ''
            },
            onloginenterclick(){
                if(!this.login){
                    this.$v.login.$touch()
                    return
                }
                if(!this.password){
                    const pf = document.getElementById('authPasswordField')
                    pf.focus()
                    return
                }
                if(this.login && this.password){
                    this.submit()
                }
            },
            onpasswordenterclick(){
                if(!this.password){
                    this.$v.password.$touch()
                    return
                }
                if(!this.login){
                    const lf = document.getElementById('authLoginField')
                    lf.focus()
                    return
                }
                if(this.login && this.password){
                    this.submit()
                }
            }
        },
    }
</script>

